// HasContest applies the HasEdge predicate on the "contest" edge.
func HasContest() predicate.ContestParticipant {
	return predicate.ContestParticipant(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, ContestTable, ContestColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasContestWith applies the HasEdge predicate on the "contest" edge with a given conditions (other predicates).
func HasContestWith(preds ...predicate.Contest) predicate.ContestParticipant {
	return predicate.ContestParticipant(func(s *sql.Selector) {
		step := newContestStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.ContestParticipant) predicate.ContestParticipant {
	return predicate.ContestParticipant(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ContestParticipant) predicate.ContestParticipant {
	return predicate.ContestParticipant(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ContestParticipant) predicate.ContestParticipant {
	return predicate.ContestParticipant(sql.NotPredicates(p))
}
